import React, { useState, useEffect } from "react";
import City from "../City";
import Point from "../Point";
import allcities from "./allcities.json";
import "./index.css";

const minE = 14.07;
const maxN = 54.9;
const maxE = 24.27;
const minN = 49.0;

const centerLat = 950 / Math.abs(maxN - minN);
const centerLong = 1000 / Math.abs(minE - maxE);

